import { useState } from "react"

export function PersonInput(props:{
    readonly onChangeName:(name:string) => void;
    readonly onChangeSurname:(surname:string) => void;
}) {
    const {onChangeName, onChangeSurname}=props;
    const [name, setName] = useState("");
    const [surname, setSurname] = useState("");
    let newName:string;
    let newSurname:string;

    return <>
        <div>PersonInput</div>
        <div>Username: <input type="text" placeholder="Inserisci nome" value={name} onChange={(ev) => {
            newName=ev.target.value;
        }} /></div>
        <div>Password: <input type="text" placeholder="Inserisci cognome" value={surname} onChange={(ev) => {
            newSurname=ev.target.value;
        }} /></div>
        <button onClick={(ev) => {
            setName(newName);
            setSurname(newSurname);
        }}>Salva</button>
    </>
}
